  return (
    <header className="header">
      <img
        src={mesto__logo}
        alt="Лого Место"
        className="header__logo"
      />

<div className="header__info">
        <p className="header__email">пример почты</p>
        <Link to="/sign-in" className="header__link">Выйти</Link>
      </div>
    </header>
  )
}

export default Header;
